    "description": "Culture Décode est une série qui a pour ambition de faire découvrir de manière originale la fabrique du numérique, l’envers du décor de notre citoyenneté numérique. À travers des épisodes humoristiques et pédagogiques, cette série permet aux ados de comprendre les éléments fondamentaux de notre culture numérique. Conçu comme une initiation aux bons usages du numérique, Culture décode informe et éveille la curiosité des jeunes téléspectateurs et les amène à faire preuve de pensée critique."
