    "title": "Interlude",
    "description": "De Federico Fellini à Guy Ritchie, nous sommes loin d’imaginer à quel point l’opéra distille son\ninfluence dans le 7ème art. Que ce soit à travers la simple utilisation d’une mélodie, un hommage ou\nune mise en scène concrète, de nombreux films font référence à l’opéra et ce n’est jamais anodin.\nOn dit souvent que l’opéra est un art total qui mélange musique, théâtre, danse... Serait-il le grand\ncousin du cinéma ? Pourquoi les scénaristes et réalisateurs choisissent-ils ce lieu pour certaines scènes ? Sont-elles\nclichées ou réalistes ? Que racontent- elles au spectateur ? Le choix de l’opéra est-il toujours anodin ?\nCes questions posent les fondements de chaque épisode d’INTERLUDE."
