    "title": "Petronix : Les défenseurs des animaux",
    "description": "Lorsque les animaux sauvages du Monde entier sont en danger, une équipe de jeunes super-héros part aussitôt à leur secours. Ils transforment leurs sacs à dos high-tech et, ensemble, s'élancent vers des missions toujours plus audacieuses.\nVoici Matt, Jia, Emma et Tim ! Loin d’être des enfants ordinaires, ces quatre copains et leurs petits compagnons ; Pupp-e (un chien curieux) ; Kitt (un chat courageux) ; Paul-e (un oiseau imaginatif) ; et Shell-e (une tortue attentionnée), réservent bien des surprises. En effet, lorsqu’à l’autre bout du monde, un animal a des ennuis, nos super-héros reçoivent une alerte sur leurs sacs à dos dont ils ne séparent jamais qui se transforment alors en petits animaux high-tech, connus sous le nom de « Petronix Pets ». Inséparables, ils s’élancent ensemble en mission de sauvetage. A l’aide de leurs capacités hors normes, nos pets sont capables de se transformer en Max Mode, véhicules que les amis peuvent piloter pendant leurs périlleuses missions. Ils forment alors une incroyable équipe de super héros défenseurs de la Nature : les Petronix. \nNos vaillants héros parcourent ainsi la planète entière pour sauver les animaux en difficulté et réaliser leur objectif : protéger la Nature. Qu’il s’agisse de foncer direction le Pôle Nord pour aider un ourson polaire coincé sur la banquise ou encore se précipiter à Bali pour sauver une baleine bleue des griffes d’un braconnier, « quand les animaux ont des problèmes, les Petronix passent à l’action!"
