    "description": "Piotta la marmotte vit dans un paysage alpin doux et chaleureux fait de laine et de coton. Elle partage ses journées avec une fleur, une chouette, un lapin, un renard et un troupeau de vaches. Dans leur monde, l'aventure est omniprésente: les collations préparées dans le laboratoire de Piotta, les jeux en plein air, la baignade dans un lac alpin, le ski dans la neige, les festivals de musique dédiés aux vaches et aux moutons et bien d'autres aventures, à découvrir en compagnie de la marmotte la plus douce des Alpes."
