    "description": "Genève. La famille Mayele jongle entre valeurs occidentales et afri­caines. Au coeur de ce dilemme quotidien, Annie, une adolescente ma­ligne et révoltée, son père, Kito, fonctionnaire international, nostalgique de l’éducation, voire de la vie, « à l’africaine » et Géraldine, la jeune et nouvelle épouse de ce dernier qui semble bien cacher son jeu. Le jour où Annie rentre de l’école, surexcitée à l’idée de se rendre avec ses amies au prochain concert de Justin Bieber, elle ne se doute pas qu’elle est sur le point d’ébranler un équilibre familial de façade. Lorsque son père trouve une minijupe dans son sac à dos, l’histoire s’emballe, tout le monde s’en mêle et c’est parti pour une cascade de situations souvent comiques, représentatives de ce qui peut se passer dans la diaspora africaine en Suisse. Autour d’eux, famille et amis influencent le trio, entre idées très arrêtées, décisions hâtives et projets insensés… Comment donc se terminera cette affaire de minijupe, et quels gros problèmes se cachent derrière ce petit bout de tissu ? - Retrouvez les 6 premiers épisodes dès le 5 décembre."
