    "title": "Papouasie",
    "description": "Papua Barat - 7 mois en Papouasie\nLundi, mardi, jeudi et vendredi à 11h dès le 9 août.\nL'équipe d'Exploraction a parcouru la province indonésienne du Papua sur l’île de Nouvelle Guinée afin de réaliser des documentaires dans les régions visitées.\nLa culture Papou est extrêmement riche et diversifiée. Dans les reportages, tu découvriras la faune et la flore terrestre ainsi qu'une vie sous-marine unique.\nLes grottes, les lacs et les régions du pays les plus inaccessibles réservent des surprises exceptionnelles."
